sources.components/checkbox/checkbox.scss:
.checkbox {
    display: flex;
    align-items: center;
    &:first-child {
        margin-right: 35px;
    }
    &__input {
        position: absolute;
        width: 0;
        height: 0;
        margin: 0;
        opacity: 0;
        &:checked {
            & + .checkbox__element:after {
                transform: translate(-50%,-50%) scale(1);
            }
        }
    }
    &__element, &__text {
        display: inline-block;
        vertical-align: middle;
    }
    &__element {
        background-color: $white;
        position: relative;
        width: 24px;
        height: 24px;
        margin-right: 8px;
        border-radius: 50%;
        border: 1px solid $white;
        transition: border-color .3s;
        overflow: hidden;
        cursor: pointer;
        @media(max-width: 400px) {
            height: 21px;
        }
        @media(max-width: 350px) {
            height: 19px;
        }
        &:hover {
            border-color: $active;
        }
        &:after {
            content: '';
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%,-50%) scale(0);
            width: 10px;
            height: 8px;
            background: url("/images/icon-check.svg") 50% 50% no-repeat;
            transition: transform .3s;
        }
    }
    &__text {
        line-height: 1.2;
        &:first-child {

        }
    }
}
@media (max-width:767px) {
    .checkbox {
        &__text {
            font-size: 14px;
        }
    }  
}

sources.components/select/select.scss:
.form {
    &__select {
        position: relative;
        & + &, & + .form__label {
            margin-top: 18px;
        }
        &.--active {
            & .form__select-head:after {
                transform: translateY(-50%) rotate3d(0,0,1,-45deg);
            }
            & .form__select-list {
                opacity: 1;
                transform: none;
                pointer-events: unset;
            }
        }
        &.--selected {
            & .form__select-head {
                color: $black;
                border-color: $border;
                background-color: white;
            }
        }
        &-input {
            position: relative;
            display: block;
            width: 100%;
            margin-bottom: 20px;
        }
        &-head {
            display: block;
            position: relative;
            width: 100%;
            max-width: 100%;
            padding: 14px 0px 17px 25px;       
            font-size: 16px;
            line-height: 18px;
            color: $text_grayL;
            border-radius: 4px;
            border: 1px solid $border;
            background-color: $white;
            transition: border-color $transition,background-color $transition;
            cursor: text;
            @media(max-width: 767px) {

            }
            &::after {
                content: '';
                display: block;
                width: 10px;
                height: 10px;
                position: absolute;
                top: 50%;
                right: 0;
                z-index: 999;
                margin-right: 20px;
                border-top: 1px solid #b2bdcc;
                border-right: 1px solid #b2bdcc;

                -webkit-transform: translateY(-50%) rotate3d(0, 0, 1, 135deg);
                transform: translateY(-50%) rotate3d(0, 0, 1, 135deg);
                -webkit-transition: -webkit-transform 0.3s ease;
                transition: -webkit-transform 0.3s ease;
                transition: transform 0.3s ease;
                transition: transform 0.3s ease, -webkit-transform 0.3s ease;
                will-change: transform;
            }
        }
        &-list {
            overflow: hidden;
            position: absolute;
            width: 100%;
            max-width: 100%;
            font-size: 16px;
            line-height: 18px;
            color: $text_black;
            border: 1px solid $border;
            border-radius: 4px;
            background-color: #fff;
            opacity: 0;
            transform: translate3d(0,20px,0);
            transition: transform $transition,opacity $transition;
            box-shadow: $shadow;
            will-change: opacity,transform;
            pointer-events: none;
            cursor: pointer;
            z-index: 10;
        }
        &-item {
            word-wrap: break-word;
            font-size: 15px;
            font-weight: 400;
            letter-spacing: 0;
            color: #333;

            padding: 14px 0px 17px 25px;       
            border-top: 1px solid $bg_gray;
            transition: background-color $transition;
            &:hover {
                background-color: $bg_gray;
            }
        }
    }
}

sources.components/input/input.scss:
.input {
    padding: 17px 0px 17px 25px;

    position: relative;
    display: block;
    // padding: 19px 24px 18px;
    border-radius: 4px;
    border: 1px solid $border;
    background-color: $white;
    transition: border-color .3s;
    cursor: text;
    &:hover {
        border-color: $active;
    }
    &.--textarea {
        min-height: 160px;
        height: 100%;
        & .input__element {
            height: 100%;
            font-family: $roboto;
            font-size: 16px;
        }
    }
    &__file {
        position: relative;
        display: block;
        width: 100%;
        cursor: pointer;
        @media(min-width: 1600px) {
            margin-left: 20px;
        }
        & input {
            position: absolute;
            width: 0;
            height: 0;
            opacity: 0;
        }
        &-el {
            display: inline-block;
            vertical-align: middle;
            & + & {
                margin-left: 5px;
            }
        }
        &-icon {
            width: 20px;
            height: 20px;
            background: url('./images/icon-clip.svg') 50% 50% no-repeat;
        }
        &-text {
            line-height: 1.2;
        }
        &-count {
            display: block;
            margin-top: 10px;
            width: 100%;
            color: $grey;
            font-size: 13px;
            transition: color .3s;
            &.--error {
                color: $error;
            }
        }
        &-start {
            display: flex;
            align-items: center;
        }
        &-end {

        }
    }
    &.--hasError {
        border-color: $error !important;
        & .input__error-msg {
            opacity: 1;
        }
        & .input__placeholder {
            opacity: 0;
        }
    }
    &.--focused, &.--hasValue {
        border-color: $active;
        & .input__element {
            opacity: 1;
        }
        & .input__error-msg, & .input__placeholder {
            transform: translateY(-15px);
            font-size: 12px;
        }
    }
    &__element {
        word-wrap: break-word;
        font-size: 15px;
        font-weight: 400;
        letter-spacing: 0;
        color: #333;

        width: 100%;
        resize: none;
        opacity: 0;
        transition: opacity .3s;
        &:focus {
            opacity: 1;
        }

        &::selection {
            background: #7f859836;
        }
    }
    &__placeholder, &__error-msg {
        top: 16px;
        font-size: 15px;

        position: absolute;
        // top: 19px;
        left: 24px;
        will-change: transform;
        transition: font-size .3s,transform .3s,opacity .3s;
    }
    &__placeholder {
        color: $formPlaceholder;
    }
    &__error-msg {
        opacity: 0;
        color: $error;
    }
}
@media (max-width:1200px) {
    .input {
        &.--textarea {
            height: 120px;
        }
    }
}
@media (max-width:767px) {
    .input {
        padding-top: 9px;
        padding-bottom: 9px;
        &__error-msg, &__placeholder {
            top: 12px;
            font-size: 12px;
        }
        &__file {
            &-text {
                font-size: 14px;
            }
            &-count {
                bottom: -1px;
            }
        }
        &.--focused, &.--hasValue {
            & .input__error-msg, & .input__placeholder {
                opacity: 0;
                transform: none;
            }
        }
    }
}
@media (max-width:450px) {
    .input {
        &.--textarea {
            height: 100px;
        }
    }
}

sources.components/form/form.scss:
.form {
    position: relative;
    &.--thanks {
        & form {
            opacity: 0;
        }
        & .form__thanks {
            visibility: visible;
        }
    }
    &.--check {
        & .form__checkNumber {
            opacity: 1;
            transition: opacity .3s;
            z-index: 1;
        }
    }
    &.--slim {
        min-height: unset;
        padding: 90px 0;
        & .container {
            width: 100%;
            max-width: 440px;
            min-width: unset;
        }
        & .form {
            &__img {
                display: none;
            }
            &__title {
                margin-bottom: 50px;
            }
            &__row {
                flex-direction: column;
                & + .form__row {
                    margin-top: 30px;
                }
            }
            &__block {
                width: 100%;
                & + .form__block {
                    margin-top: 30px;
                }
            }
        }
    }
    & .link {
        font-size: 13px;
        color: $white;
        border-color: $white;
    }
    &__img {
        position: absolute;
        top: 50%;
        left: 100px;
        transform: translateY(-50%);
    }
    &__container {
        position: relative;
        margin: 0 auto;
        z-index: 1;
    }
    &__checkNumber {
        position: absolute;
        top: 0;
        left: 0;
        right: 0;
        bottom: 0;
        z-index: 0;
        display: flex;
        align-items: center;
        justify-content: center;
        background-color: $formBg;
        opacity: 0;
    }
    &__title {
        position: relative;
        margin-bottom: 80px;
        font-size: 36px;
        text-align: center;
        line-height: 1.2;
        & span {
            position: absolute;
            left: 0;
            right: 0;
            bottom: -20px;
            font-family: $roboto;
            font-size: 13px;
            color: $grey;
        }
    }
    &__row {
        display: flex;
        justify-content: space-between;
        & + & {
            margin-top: 40px;
        }
    }
    &__block {
        width: calc(100% / 2 - 10px);
        &.--links {
            display: flex;
        }
        &-license {
            display: flex;
            justify-content: space-between;
            align-items: baseline;
            @media(max-width: 767px) {
                flex-direction: column;
                align-items: flex-start;
                margin: 0 auto;
            }
        }
    }
    &__file {
        margin-top: 10px;
    }
    &__textarea {
        height: 100%;
        margin: 20px 0px 20px;
    }
    &__input {
        & + & {
            margin-top: 20px;
        }
    }
    &__button {
        width: 100%;
        max-width: 290px;
        padding: 16px 30px 16px;
        font-size: 16px;
        font-weight: 200;
        font-weight: 400;
        border-radius: 4px;
        background-image: linear-gradient(to top,#f28525 0%,#e97c20 100%);
        transition: filter .3s;
        @media (max-width: 767px) {
            padding: 16px 30px 15px;
            font-size: 17px;
        }
        &[disabled] {
            filter: grayscale(1);
            pointer-events: none;
        }
        &:not([disabled]):hover {
            background-image: linear-gradient(to bottom,#f28525 0%,#e97c20  100%);
        }
    }
    &__thanks {
        visibility: hidden;
        width: 100%;
        height: auto;
        top: 0;
        left: 0;
        z-index: 50;
        position: absolute;
        &-title {
            margin-bottom: 30px;
            font-size: 36px;
            text-align: center;
            line-height: 1.2;
        }
        &-description {
            z-index: 50;
            max-width: 400px;
            margin: 0 auto;
            font-size: 19px;
            text-align: center;
            & a {
                display: block;
                margin: 10px 0;
                font-size: 1.8em;
                font-weight: 700;
                transition: color .3s;
                &:hover {
                    color: $active;
                }
            }
        }
    }
}
.--submit {
    text-align: center;
    margin: 0 auto;
    margin-top: 30px;
}

@media (max-width:1200px) {
    .form {
        padding: 0;
        background-color: transparent;
        &.--slim {
            padding: 0;
            & .container {
                max-width: unset;
                margin: 0;
                // padding: 90px 0;
            }
            & .form__container {
                max-width: 420px;
            }
        }
        & .container {
            width: unset;
            // margin: 0 40px;
            // padding-top: 95px;
            // padding-bottom: 135px;
            border-radius: 4px;
        }
    }
}
@media (max-width: 570px) {
    .form {
        &__container {
            max-width: 420px;
        }
        &:not(.--slim) {
            & .form__title {
                width: 500px;
                margin-left: -40px;
                margin-bottom: 40px;
            }
        }
        &__row {
            flex-direction: column;
            & + & {
                margin-top: 30px;
            }
        }
        &__block {
            width: 100%;
            & + & {
                margin-top: 20px;
            }
            &.--submit {
                margin-top: 30px;
                text-align: center;
            }
        }
    }
}
@media (max-width:767px) {
    .form {
        &.--slim {
            & .container {
                width: auto;
                margin: 0px;
                padding-left: 10px;
                padding-right: 10px;
            }
            & .form__submit {
                font-size: 14px;
            }
        }
        &:not(.--slim) {
            & .form__title {
                width: auto;
                margin-left: 0;
                margin-right: 0;
                margin-bottom: 30px;
            }
        }
        &__title {
            font-size: 22px;
            & span {
                bottom: -18px;
                font-size: 12px;
            }
        }
        &__thanks {
            &-title {
                font-size: 29px;
            }
            &-description {
                font-size: 16px;
                & a {
                    margin: 15px 0;
                }
            }
        }
    }
}
@media (max-width:375px) {
    .form {
        &.--slim {
            & .container {
                padding-top: 15px;
                padding-bottom: 15px;
            }
        }
        & .container {
            margin: 0;
            border-radius: 0;
        }
    }
}

